const char* getNamedResource (const char* resourceNameUTF8, int& numBytes);
const char* getNamedResource (const char* resourceNameUTF8, int& numBytes)
{
    unsigned int hash = 0;

    if (resourceNameUTF8 != nullptr)
        while (*resourceNameUTF8 != 0)
            hash = 31 * hash + (unsigned int) *resourceNameUTF8++;

    switch (hash)
    {
        case 0x6abebe70:  numBytes = 6148; return _DS_Store;
        case 0x2bb6c917:  numBytes = 1419; return Clear_png;
        case 0xff6fb41c:  numBytes = 673; return Eyedropperoff_png;
        case 0x950e4ea6:  numBytes = 671; return Eyedropperon_png;
        case 0x7cb93db5:  numBytes = 25781; return Logo_png;
        case 0x4c7e0f32:  numBytes = 941; return Search_png;
        default: break;
    }

    numBytes = 0;
    return nullptr;
}

